import React from "react";

const About = () =>{
    return(
        <>
        <div>
      <h2>About Us</h2>
      <p>Welcome to our website!</p>
      <p>We are a team of passionate developers creating awesome web applications using React.</p>
      <p>Feel free to explore our website and learn more about our products and services.</p>
    </div>
        
        </>
    )
}
export default About;
